import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Navbar.css'; // Import the CSS file

// Navbar component styled to look like the provided image
const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <img src="/images/logo.png" alt="Logo" className="navbar-logo" />
      </div>
      <ul className="navbar-center">
        <li><a href="/">About Us</a></li>
        <li><a href="/">Sensors</a></li>
        <li><a href="/"> Farm Data</a></li>
      </ul>
      <div className="navbar-right">
        <button className="navbar-search">
          <span role="img" aria-label="search">üîç</span>
        </button>
        <a href="/login" className="navbar-login">Log in</a>
        <a href="/signup" className="navbar-signup">Sign up</a>
      </div>
    </nav>
  );
};

const UserList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        const response = await axios.get('/api/users');
        setUsers(response.data);
      } catch (error) {
        console.error('Error fetching users', error);
      }
    };
    fetchUsers();
  }, []);

  return (
    <div>
    </div>
  );
};

export default UserList;
